import React from "react";
import ButtonMain from "../../components/ButtonMain/ButtonMain";
import { buttonRed, buttonYellow } from "../../utils/colorClasses";

export default function Main() {
  let letterButtons = []
  for (let letter of "ABCDEFGHIJKLMNOPQRSTUVWXYZ") {
    letterButton.push(<>
      <ButtonMain buttonClass={buttonYellow}>{letterButton}</ButtonMain>
    </>);
  }
  return (
    <>
      <ButtonMain buttonClass={buttonYellow}>{letterButton}</ButtonMain>
      <ButtonMain buttonClass={buttonRed}>{letterButton}</ButtonMain>
      <ButtonMain buttonClass={buttonRed}>Letter C</ButtonMain>
    </>
  );
}
